GType
xfce_panel_module_init (GTypeModule* module)
{
	GType result = 0UL;
	g_return_val_if_fail (module != NULL, 0UL);
	rocker_plugin_register_type (module);
	rocker_service_register_type (module);
	rocker_service_proxy_register_dynamic_type (module);
	result = ROCKER_TYPE_PLUGIN;
	return result;
}

